import React from 'react';

const projects = [
  {
    title: 'MERN Task Manager',
    desc: 'Full-stack task manager with user auth, CRUD tasks, and REST APIs. (React, Node, Express, MongoDB)',
    link: '#',
  },
  {
    title: 'E‑commerce UI & API',
    desc: 'Prototype + production-ready API for product listing, cart, checkout (Stripe).',
    link: '#',
  },
  {
    title: 'React Native App',
    desc: 'Mobile app scaffold with navigation, offline storage and push notifications.',
    link: '#',
  },
];

export default function Projects() {
  return (
    <div className="container projects">
      <h2>Projects</h2>
      <div className="projects-grid">
        {projects.map((p, i) => (
          <article key={i} className="project-card">
            <h3>{p.title}</h3>
            <p>{p.desc}</p>
            <a className="btn btn-sm" href={p.link} target="_blank" rel="noreferrer">View</a>
          </article>
        ))}
      </div>
      <p className="muted">Replace projects with your real GitHub links / case studies from LinkedIn.</p>
    </div>
  );
}
